pragma solidity >=0.4.22 <0.6.0;

contract example1 {
    address public organizer;
    address public charity;
    string public organizerName;
    string public charityName;
    uint public startTime;
    struct sponsor{
        address sponsorAddress;
        uint sponsorMoney;
        uint sponsorTime;
    }
    mapping (address=>sponsor) public sponsors;
    modifier onlyOrganizer{
        require(msg.sender == organizer);
        _;
    }
    constructor(string memory _organizerName, string memory _charityName, address _charity) public{
        organizer = msg.sender;
        charity = _charity;
        organizerName = _organizerName;
        charityName = _charityName;
        startTime = now;
    }
    function make_payable(address x) internal pure returns(address payable){
        return address(uint160(x));
    }
    function donate() public payable {
        sponsors[msg.sender] =sponsor({
            sponsorAddress :msg.sender ,
            sponsorMoney : msg.value,
            sponsorTime : now
        });
    }
    function sendMoney() public onlyOrganizer {
        make_payable(charity).transfer(address(this).balance);
    }
}
